)"]},{"cell_type":"markdown","id":"93fb0dba","metadata":{"papermill":{"duration":0.009051,"end_time":"2023-10-31T11:38:25.08998","exception":false,"start_time":"2023-10-31T11:38:25.080929","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"ef491fdf","metadata":{"papermill":{"duration":0.008941,"end_time":"2023-10-31T11:38:25.108857","exception":false,"start_time":"2023-10-31T11:38:25.099916","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"e483b79b","metadata":{"execution":{"iopub.execute_input":"2023-10-31T11:38:25.132515Z","iopub.status.busy":"2023-10-31T11:38:25.130456Z","iopub.status.idle":"2023-10-31T11:38:25.209592Z","shell.execute_reply":"2023-10-31T11:38:25.206959Z"},"papermill":{"duration":0.093978,"end_time":"2023-10-31T11:38:25.21279","exception":false,"start_time":"2023-10-31T11:38:25.118812","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>abrad